import React from 'react';
import { useState } from 'react';
import { data } from './data'

const UseStateCards = () => {
    const [people, setPeople] = useState(data);
    return (
        <>
            {people.map((person) => {
                const { id, name, age } = person
                return (
                    <div key={id} className="item">
                        <h4>{name}</h4>
                        <h6>{age}</h6>
                    </div>
                );
            })}
        </>
    );
};

export default UseStateCards;
